INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 125801, 1, 1, 0, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", "リリ", 321, 24001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 126001, 1, 2, 0, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", "クリア", 322, 24001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 126101, 1, 3, 0, "んーと。\nこれ、あげる。\nはい", "プレシア", 323, 24001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 125801, 2, 4, 0, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", "リリ", 324, 24001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 126001, 2, 5, 0, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", "クリア", 325, 24001, 1);
INSERT INTO `v1_7bcce2e7d420f9f208102100eb536916e62bff4a57f4931571ae23d1a6725d96` VALUES (40011, 2, 126101, 2, 6, 0, "お兄。\nきてくれて、うれしい", "プレシア", 326, 24001, 1);
